import React from "react";
import FieldComponent from "./FieldComponent/FieldComponent";

function FormSection(props) {
    let section = props.section;
    let informationList = (section.InformationList) ? section.informationList : null;
    return (<>
        <p><h3> {section.SectionName}  </h3>
            <h5> {section.Information} </h5></p>
        <ul>
            {

                section.InformationList.forEach(listItem => {
                    return <li>{listItem}</li>
                })
            }
        </ul>
        {
            section.Fields.map(entry => {
                return <FieldComponent
                    fieldConfig={entry}
                />
            })
        }
        {/* section.Fields.map(entry => {
                    //console.log(entry);
                    return <FieldComponent
                        fieldConfig={entry}
                    />
                }) */}
    </>);
}

export default FormSection;
